//HOVER CARD
    function mainCardHoverOn(){
        $(".js-main-card").on({
            mouseenter: hoverInMainCard,
            mouseleave: hoverOutMainCard
        });
    }

    function mainCardHoverOff() {
        $(".js-main-card").off({
            mouseenter: hoverInMainCard,
            mouseleave: hoverOutMainCard
        });
    }

    function hoverInMainCard() {
        var glow = $(this).find('.js-glow');
        TweenMax.to(".js-main-card", 0.5, {scale:"0.9", opacity: "0.75", ease:Power2.easeInOut});
        TweenMax.to(this, 0.5, {scale:"1.1", opacity: "1", ease:Power2.easeInOut});
        TweenMax.to(glow, 0.5, {opacity:"0.75", ease:Power2.easeInOut});
    }
    function hoverOutMainCard(e) {
        if (!$(".js-main-card").hasClass('wrapped')) {
            scaleToInitial();
        } else {
            showOption(e);
        }
    }
//END


//OPTION LIST
    function toInitialMainCards() {
        // var rotateElem = $(".main-card-wrap");
        var faceup = $('.js-faceup');
        var facedown = $('.js-facedown');
        rotateToFaceDown(faceup, facedown);
        setTimeout (function(){
            scaleToInitial();
        },1000);
    }

//START function
    function start(e) {
        e.preventDefault();
        if (!$("#sound").hasClass('mute')){
            soundFlip.play();   
        }
        var current = $(e.currentTarget);
        var data = $(current).data('main_cards');
        toInitialMainCards();
        mainCardPostion(data);
        moveMainCardsCenter();
        removezIndex();
        current.addClass('hide');
        TweenMax.to(".js-start", 0.5, {opacity: "0", ease:Power2.easeInOut});
        $('.nav__flex-top').addClass('show');
        TweenMax.to(".nav__flex-top", 0.5, {opacity: "1", ease:Power2.easeInOut});
        removeSplash();
    }

    function backHand(e){
        var activeGame = $(".game.active");
        var gameId = $(activeGame).attr('id');
        var mainCard = $(".js-main-card[data-main_card="+gameId+"]");
        var faceup = $(mainCard).find('.js-faceup');
        var facedown = $(mainCard).find('.js-facedown');
        var data = "initial";

        if ($(".game").hasClass('active')) {
            TweenMax.to(".game.active", .5, {opacity:1, ease:Power2.easeInOut});
            removeBackButton();
            showBackButton();
            closeMenu();
            hideHandDesc();
            mainCardPostion(data);
            if (!mq.matches){
               moveMainCardsLeft();
            }
            TweenMax.to(".js-main-card", 1, {scale:"0.85", opacity: 1, ease:Power2.easeInOut});
            TweenMax.to(mainCard, 1, {scale:"1.3", ease:Power2.easeInOut});

            if ($("#js-section-rules").hasClass('active')){
                showTable();
                setTimeout(function(){
                    TweenMax.to("#poker_table", .5, {opacity:1, ease:Power2.easeInOut});             
                },500);
            } else {
                zoomInMainCards();
                TweenMax.to(".js-faceup", 1, {rotationY:"180", scale: "1", ease:Power2.easeInOut});
                TweenMax.to(".js-facedown", 1, {rotationY:"0", scale: "1", ease:Power2.easeInOut});
                rotateToFaceUp(facedown, faceup);
                removeActiveMainCards();
            }
        } else {
            goBack(e);
        }
    }

    function goBack(e) {
        e.preventDefault();
        if (!$("#sound").hasClass('mute')){
            soundFlip.play();   
        }
        showInstruction()
        mainCardHoverOn();
        closeMenu();
        showClouds();
        hideHandDesc();
        var current = $(e.currentTarget);
        var data = "options";
        toInitialMainCards();
        removeBackButton();
        $('.js-main-card').removeClass('wrapped');
        TweenMax.to(".js-main-card", 1.5, {scale:"1", opacity:"1", ease:Power2.easeInOut});

        setTimeout(function(){
            mainCardPostion(data);
            zoomInMainCards();
            moveMainCardsCenter();
        },750);
        setTimeout(function(){
            removezIndex();
        }, 2000);
        $('.js-game').removeClass('active');
        hideSection();
        removeActiveTab();
        hideTable();
        hideTabs();
        hideNavLine();

        TweenMax.to(".js-table-stage", 1, {opacity:"0", ease:Power2.easeInOut});
        $('.game__tabs').removeClass('active');
        $('.js-table-stage').removeClass('show');
        $('.js-table-step').removeClass('active');
        $('.js-table-step').removeClass('focus');
    }
    
    function removezIndex() {
        $('.js-main-card').removeClass('index');
    }
//END


//SHOW OPTION
    function showOption(e) {
        e.preventDefault();
        mainCardHoverOff();
        hideInstruction();
        removeClouds();
        if (!$("#sound").hasClass('mute')){
            soundFlip.play();   
        }
        var current = $(e.currentTarget);
        var currentGameData = $(current).data("main_card");

        var data = "initial";

        //Load ajax for game HTML
        $("#game").load(currentGameData + ".html #" + currentGameData, loadedGame);

        mainCardPostion(data);
        if (!mq.matches){
            moveMainCardsLeft();
        }
        current.addClass('index');
        $(".js-main-card").addClass('wrapped');
        TweenMax.to(".js-main-card", 1, {scale:"0.85", ease:Power2.easeInOut});
        TweenMax.to(current, 1, {scale:"1.3", ease:Power2.easeInOut});
        removeActiveMainCards();
        showBackButton();


    
        return false;
    }

        //FUNCTION FOR THE GAME
        function loadedGame(){
            var currentGameData = $('.js-game').attr('id');
            $(".js-game").addClass('active');
            $('.game__tabs').addClass('active');
            showIntro();
            showTabs();
            firstActiveTab();
            //change table images
            gameImages(currentGameData);
        }

    function firstActiveTab() {
    	var firstTab = $('.js-game').find('.js-tab:first-child');
    	firstTab.addClass('active');
    	TweenMax.to(firstTab, 0.5, {opacity:"1", scale:"1.1", ease:Power2.easeInOut});
    }

    function activeTab(tab) {
    	var siblings = $(tab).siblings('.js-tab');
    	siblings.removeClass("active");
    	TweenMax.to(siblings, 0.5, {scale:"1", ease:Power2.easeInOut});
    	tab.addClass("active");
    	TweenMax.to(tab, 0.5, {scale:"1.1", ease:Power2.easeInOut});
    }

    function removeActiveTab(){
    	$(".js-tab").removeClass('active');
    	TweenMax.to(".js-tab", 0.5, {opacity:"0.8", scale:"1", ease:Power2.easeInOut});

    }

//MAIN CARD POSITIONS
    function mainCardPostion(data) {
        var main_card = main_cards.filter(function ( main_card ) {
            return main_card.stage === data;
        })[0];

        for (var i = 1; i < 6; i++) {
            var left = main_card["main_card_"+i+"_left"]+"%";
            var top = main_card["main_card_"+i+"_top"]+"%";
            if ( data === "options" ) {
            	TweenMax.to('.main_card_' + i, 1.5, {x:left, y: top, ease:Power2.easeInOut, onComplete: showTitle});
            } else {
        		TweenMax.to('.js-card-title', 0.5, {bottom:"90%", opacity:"0"});    	
            	TweenMax.to('.main_card_' + i, 1.5, {x:left, y: top, ease:Power2.easeInOut});
            }
        }
    }

    //add title to the cards 
    function showTitle() {
     	TweenMax.fromTo('.js-card-title', 0.5, {bottom:"90%", opacity:"0"}, {bottom:"105%",opacity:"1"});
     	$('.main-cards').addClass('active');
    }
//END

// MAIN CARDS POSITION FOR 

	function mainCardPostionHand(data) {
        var main_card = main_cards.filter(function ( main_card ) {
            return main_card.stage === data;
        })[0];

        for (var i = 1; i < 6; i++) {
            var left = main_card["main_card_"+i+"_left"]+"%";
            var top = main_card["main_card_"+i+"_top"]+"%";       
        	TweenMax.to('.js-card-title', 0.5, {bottom:"90%", opacity:"0"});
            TweenMax.to('.main_card_' + i, 1.5, {x:left, y: top, ease:Power2.easeInOut});
        }
    }


//POKER HANDS MENU

