	function showPrevHand(e){
		e.preventDefault();
		var current = $(e.currentTarget);
		var activeHand = $(current).closest('.js-hand-description');
		var prevHand = $(activeHand).prev('.js-hand-description');
		// var rotateElem = $('.main-card-wrap');

		var faceup = $('.js-faceup');
        var facedown = $('.js-facedown');

		var lastHand = $('.js-hand-description').last();
		var image = $(prevHand).data('image') || $(lastHand).data('image');
		var activeTitle = $(activeHand).find('.js-hand-title');

		activeHand.removeClass('active');
		TweenMax.to(activeHand, 0.5, {opacity:"0", ease:Power0.easeInOut});
		TweenMax.fromTo(activeHand, 0.5, {x:"-50%", y:"-50%"}, {x:"-75%",y:"-50%"});
		TweenMax.fromTo(activeTitle, 0.5, {x: "0%"}, {x: "-30%"});

		mainCardHoverOff();
        removeActiveMainCards();
        scaleToInitial();

		if (prevHand.length) {
			TweenMax.to(faceup, 1, {rotationY:"180", scale: "1", ease:Power2.easeInOut});
			TweenMax.to(facedown, 1, {rotationY:"0", scale: "1", ease:Power2.easeInOut, onComplete:completeNextHand, onCompleteParams: [image, prevHand]});
		} else {
			TweenMax.to(faceup, 1, {rotationY:"180", scale: "1", ease:Power2.easeInOut});
			TweenMax.to(facedown, 1, {rotationY:"0", scale: "1", ease:Power2.easeInOut, onComplete:completeNextHand, onCompleteParams: [image, lastHand]});
		}
	}

	function completePrevHand(image, prevHand, lastHand){
		imagePokerHands(image);
		var title = $(prevHand).find('.js-hand-title') || $(firstHand).find('.js-hand-title');
		if (prevHand.length){
			TweenMax.to(prevHand, 1, {opacity:"1", ease:Power0.easeInOut});
			TweenMax.fromTo(prevHand, 0.5, {x:"-25%", y:"-50%"}, {x:"-50%",y:"-50%"});
			TweenMax.fromTo(title, 0.5, {x: "30%"}, {x: "0%"});
			setTimeout(function(){
				prevHand.addClass('active');
			},500);
		} else {
			lastHand.addClass('active');
			TweenMax.to(lastHand, 1, {opacity:"1", ease:Power0.easeInOut});
			TweenMax.fromTo(lastHand, 0.5, {x:"-25%", y:"-50%"}, {x:"-50%",y:"-50%"});
			TweenMax.fromTo(title, 0.5, {x: "30%"}, {x: "0%"});
		}
	}


