    function hideSection(){
        var section = $('.js-section.active');
        var stage = $(section).find(".js-stage.active");
        var step = $(stage).find('.js-step.active');
    //right nav
        var stageNavs = $(section).find('.js-stage-nav');
        var stepNavs = $(section).find('.js-step-nav');

        $('.js-stages-navigation').removeClass('active');

        stageNavs.removeClass('active');
        stageNavs.removeClass('focus');

        stepNavs.removeClass('active');
        stepNavs.removeClass('focus');

        section.removeClass('active');
        stage.removeClass('active');
        step.removeClass('active');

        //Table nav
        $('.table__step').removeClass('active');
        $('.table__step').removeClass('focus');

        TweenMax.fromTo(stage, 1, {x:"-50%", y:"-50%", opacity:"1"},{x:"0%", y:"-50%", opacity:"0",ease:Power2.easeInOut});
        var stageTitle = $(stage).find('.js-stage-description');
        TweenMax.fromTo(stageTitle, 1, {x: "0%"}, {x:"50%", ease:Power2.easeInOut});

        TweenMax.to(section, 1, {opacity:"0", ease:Power2.easeInOut});
        TweenMax.to(step, 0.5, {opacity:"0", ease:Power2.easeInOut, onComplite: hideAllItems});
        

        $('.eye').removeClass('hide');
        hideNavLine();
    }




